import React,{Component} from 'react';
import Persons from './persons'

function NameList(){
	const pers = [
		'bob',
		'2']
        const personsList = persons.map((person) =>  <h1>{person}</h1>)
	
    return (<div>{personsList}</div>)
}	
export default NameList
